-- Table structure for `customerneed`
-- ----------------------------
DROP TABLE IF EXISTS `customerneed`;
CREATE TABLE `customerneed` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(50) DEFAULT NULL COMMENT 'รหัสลูกค้า',
  `title` varchar(255) DEFAULT NULL COMMENT 'เรื่อง',
  `customername` varchar(255) DEFAULT NULL COMMENT 'ชื่อสถานบริการ/บริษัท',
  `customrttype` int(3) DEFAULT NULL COMMENT 'ประเภทสถานพยาบาล',
  `address` varchar(255) DEFAULT NULL COMMENT 'ที่อยู่',
  `tel` varchar(20) DEFAULT NULL COMMENT 'เบอร์โทรศัพท์สำนักงาน',
  `contact` varchar(255) DEFAULT NULL COMMENT 'ชื่อผู้ติดต่อและเบอร์โทรศัพท์',
  `dayopen` varchar(255) DEFAULT NULL COMMENT 'วัน - เวลา ที่เปิดทำการ',
  `location` varchar(255) DEFAULT NULL COMMENT 'สถานที่ตั้ง',
  `roundofweek` int(10) DEFAULT NULL COMMENT 'รอบจัดเก็บ (ครั้งต่อสัปดาห์)',
  `roundofmount` int(10) DEFAULT NULL COMMENT 'รวมจำนวนครั้งต่อเดือน',
  `priceofonetime` int(11) DEFAULT NULL,
  `priceofmount` int(10) DEFAULT NULL COMMENT 'ราคาต่อเดือน',
  `priceofyear` int(10) DEFAULT NULL COMMENT 'ราคาต่อปี',
  `typebill` int(3) DEFAULT NULL COMMENT 'ออกบิลในนาม 1 = นิติบุคคล 2 = บุคคลธรรมดา',
  `roundprice` int(1) DEFAULT NULL COMMENT 'รอบการชำระเงิน',
  `detail` text COMMENT 'รายละเอียดอื่น ๆ',
  `changwat` int(11) DEFAULT NULL,
  `amphur` int(11) DEFAULT NULL,
  `tambon` int(11) DEFAULT NULL,
  `zipcode` varchar(10) DEFAULT NULL,
  `status` int(1) DEFAULT NULL COMMENT '0 = ยังไม่ดำเนินการ 1 = ดำเนินการทำบเสนอราคาแล้ว 2 = ยกเลิก',
  `d_update` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT 'วันที่บันทึก',
  `vat` int(1) DEFAULT '0' COMMENT '0 = ไม่รวม vat 1 = รวม vat',
  `duedate` varchar(100) DEFAULT NULL COMMENT 'วันที่กำหนดส่งมอบงาน',
  `createdittime` varchar(100) DEFAULT NULL COMMENT 'เครดิตการชำระเงิน',
  `numpoint` int(3) DEFAULT NULL COMMENT 'จำนวนจุดจัดเก็บ',
  `locationpoint` text COMMENT 'สถานที่จัดเก็บ',
  `NO` varchar(20) DEFAULT NULL COMMENT 'เลขที่ใบเสนอราคา',
  `comment` longtext COMMENT 'เงื่อนไขใบเสนอราคา',
  `payment` varchar(255) DEFAULT NULL COMMENT 'การชำระเงิน',
  `expiredate` varchar(255) DEFAULT NULL COMMENT 'ยืนยันราคาภายใน',
  `distcount` decimal(10,2) DEFAULT NULL COMMENT 'ส่วนลลด',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='ความต้องการลูกค้า/ใบเสนอราคา';

