  `dateinvoice` date DEFAULT NULL COMMENT 'วันที่ออกใบแจ้งหนี้',
  `datebill` date DEFAULT NULL COMMENT 'วันที่ออกใบเสร็จ',
  `typeinvoice` int(1) DEFAULT NULL COMMENT '0 = ค่ากำจัดขยะติดเชื้อ 1 = ค่าบริการขยะส่วนเกิน',
  `slip` varchar(100) DEFAULT NULL COMMENT 'หลักฐาน',
  `bank` int(3) DEFAULT NULL COMMENT 'ธนาคารที่โอน',
  `discount` decimal(10,2) DEFAULT '0.00' COMMENT 'ส่วนลด',
  `deposit` decimal(10,2) DEFAULT NULL COMMENT 'มัดจำ',
  `credit` int(10) DEFAULT NULL COMMENT 'เครดิตวันชำระเงิน',
  `checkdateinvoice` int(1) DEFAULT '0' COMMENT '1 = invoice เอาวันที่',
  `checkdatebill` int(1) DEFAULT '0' COMMENT '1 = bill เอาวันที่',
  `typepayment` int(1) DEFAULT '2' COMMENT 'ประเภทยืนยัน 1 = ผ่านระบบ 2 ผ่านช่องทางอื่น ๆ',
  `userid` int(11) DEFAULT NULL COMMENT 'รหัสเจ้าหน้าที่ยืนยัน',
  `dateconfirm` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT 'วันที่เจ้าหน้าที่ยืนยัน',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='ตารางเก็บใบแจ้งหนี้ / ใบเสร็จ';

